import Icon from './Icon.vue'

export default {
  name: 'IconTag',

  functional: true,

  props: {
    name: {
      type: String,
      required: true,
    },

    icon: {
      type: String,
      required: true,
    },

    size: {
      type: String,
      default: '1x',
    },
  },

  render (h, { props: { name, icon, size } }) {
    return (
      <span
        class="post-tag"
        title={name}
      >
        <Icon
          class="post-tag-icon"
          name={icon}
          size={size}
        />

        <span class="post-tag-name">
          { name }
        </span>
      </span>
    )
  },
}
